import React from 'react';
import SignIn from './SignIn'
import { Provider } from 'react-redux'
import './App.css';
import WebSocketProvider from './utils/WebSocket';
import store from './utils/store';
const App = () => {
  return (
    <Provider store={store}>
      <WebSocketProvider>
        <SignIn />
      </WebSocketProvider>
    </Provider>
  )
}
